// RemoveArchivedBy relationship.
// Sets o.R.ArchivedBy to nil.
// Removes o from all passed in related items' relationships struct (Optional).
func (o *Stock) RemoveArchivedBy(ctx context.Context, exec boil.ContextExecutor, related *User) error {
	var err error

	queries.SetScanner(&o.ArchivedByID, nil)
	if _, err = o.Update(ctx, exec, boil.Whitelist("archived_by_id")); err != nil {
		return errors.Wrap(err, "failed to update local table")
	}

	o.R.ArchivedBy = nil
	if related == nil || related.R == nil {
		return nil
	}

	for i, ri := range related.R.ArchivedByStocks {
		if queries.Equal(o.ArchivedByID, ri.ArchivedByID) {
			continue
		}

		ln := len(related.R.ArchivedByStocks)
		if ln > 1 && i < ln-1 {
			related.R.ArchivedByStocks[i] = related.R.ArchivedByStocks[ln-1]
		}
		related.R.ArchivedByStocks = related.R.ArchivedByStocks[:ln-1]
		break
	}
	return nil
}

